import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello World !</h1>
      </header>
	  <body>
		  <p></p>
	  </body>
    </div>
  );
}

var Square = React.createClass({
    render: function() {
        return (
            <View style={styles.square} />
        )
    }
});

export default App;
